const interUrl =
  'https://fonts.googleapis.com/css?family=Inter:300,300i,400,400i,500,500i,600,600i,700,700i&display=swap';

export const globals = {
  font: {
    size: '16px',
    family: '"Inter", sans-serif',
    url: interUrl,
  },
  focus: {
    color: '#005CE4',
  },
  background: {
    color: '#E4EBF1',
  },
};
